import styled from "styled-components";

export const Wrapper = styled.main`
  position: relative;
  max-width: 100%;
  margin: 0 auto;
`;

export const HeroSection = styled.section`
  background-color: #000;
  text-align: center;
  min-height: 660px;
  height: 93vh;
`;
